import React from "react";
import logo from "./bob.jpeg";
import "./App.css";

function App() {
	return (
		<div className="App">
			<header className="App-header">
				<p>COMING SOON: Robert Cereghini</p>
				<a className="App-link" href="https://rcereghini.github.io/" target="_blank">
					Old Portfolio
				</a>
			</header>
		</div>
	);
}

export default App;
